import React from 'react';
import './Dashboard.css';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>Admin Dashboard</h1>
      <div className="dashboard-grid">
        <Link to="/admin/add-product" className="dashboard-card">Add Product</Link>
        <Link to="/admin/all-orders" className="dashboard-card">View Orders</Link>
        <Link to="/admin/users" className="dashboard-card">Manage Users</Link>
      </div>
    </div>
  );
};

export default Dashboard;
